import React, { Component } from "react";
import Navbar from "../components/layouts/navbar";

const ShowContent = ({ title, content }) => {
  return (
    <React.Fragment>
      <div className="title">{title}</div>
      <div className="content">
        <p>{content}</p>
      </div>
    </React.Fragment>
  );
};

class FAQ extends Component {
  question_and_answer = [
    {
      question: "What?",
      answer: "Hello World"
    },
    {
      question: "What kinds of dogs are there?",
      answer: "Hello World"
    },
    {
      question: "How do you acquire a dog?",
      answer: "Hello World"
    }
  ];

  constructor() {
    super();
    this.state = {
      showConent: true
    };
  }

  fn_toggle = () => {
    this.setState({ showConent: !this.state.showConent });
  };

  render() {
    return <h2>Hello</h2>;
  }
}

export default FAQ;
